import AvatarSvg from "../../../assets/avatar";
import "./EmployeePage.scss";

export default function EmployeePage(props) {
  const {
    name,
    role,
    department,
    tasks,
    projects,
    availability,
    email,
    phone,
    linkedin,
    teams,
  } = props.employee;

  console.log(props.employee)
  return (
    <div className="employeePage">
      <div id="data">
        <div id="employeeCard">
          <h2>{name}</h2>
          <p>{role}</p>
        </div>

        <button>Delete user</button>

        <div className="label">
          <span>Department:</span>
          <span>{department}</span>
        </div>

        <div className="label">
          <span>Tasks:</span>
          {(tasks.split(",")) > 0 && (tasks.split(",")).map((t) => <span>{t}</span>)}
          {(tasks.split(",")) === 0 && <i>None</i>}
        </div>

        <div className="label">
          <span>Projects:</span>
          {projects.split(",") > 0 && projects.split(",").map((p) => <span>{p}</span>)}
          {projects.split(",") === 0 && <i>None</i>}
        </div>

        <div className="label">
          <span>Availability:</span>
          <span>{availability}</span>

          <button>change</button>
        </div>
      </div>

      <div id="contact">
        <AvatarSvg />
        {/* <div>
          <h2>Contact information</h2>
          {email && <span>Email: {email}</span>}
          {phone && <span>Phone: {phone}</span>}
          {linkedin && <span>LinkedIn: {linkedin}</span>}
          {teams && <span>Microsoft Teams: {teams}</span>}
        </div> */}
      </div>
    </div>
  );
}
